import * as React from "react";
import "./Home.css";
import Navbars from "../Navbar/navbarHome";
import Footer from "../Footer/Footer";
import { BsArrowRightShort } from "react-icons/bs";

import Online_document from "../../Images/Online_document.png";
import Documents from "../../Images/Documents-amico.png";
import Translator from "../../Images/Translator-bro.png";
import Selecting_team from "../../Images/Selecting_team.png";

import { useNavigate, useLocation } from "react-router-dom";
import { overviewEN, overviewTH, overviewDE } from "../Data/DataLanguage";

import { Modal, Typography, Box } from "@mui/material";

const Home = () => {
  const location = useLocation();
  const navigate = useNavigate();
  let Doc = location?.state?.languages;
  let Aoc = location?.state?.accept;

  const [open, setOpen] = React.useState(false);

  const handleClose = (x) => {
    console.log(x);
    if (x === 1) {
      navigate("/", { state: { languages: `${x}`, accept: true } });
      setOpen(false);
    } else {
      setOpen(false);
      navigate("/", { state: { languages: `${x}`, accept: false } });
    }
  };
  React.useEffect(() => {
    if (Aoc === true) {
      setOpen(false);
    } else {
      setOpen(true);
    }
  }, []);

  const goSignup = (x) => {
    navigate("/Signup", { state: { languages: `${x}` } });
  };

  const goCustomer = (x) => {
    navigate("/Home/Services/Customer", { state: { languages: `${x}` } });
  };

  const goTranslator = (x) => {
    navigate("/Home/Services/Translator", { state: { languages: `${x}` } });
  };

  // const pathname = window.location.pathname;
  // console.log("Doc:", typeof Doc);
  // console.log("pathname:", pathname);

  // const [type, settype] = React.useState(null);
  // const [textarea, setTextarea] = React.useState("");
  // const [file, setFile] = React.useState("");

  // const handleChange = (event) => {
  //   setTextarea(event.target.value);
  // };

  // const promotion = (x) => {
  //   window.scrollTo(0, 1500);
  // };

  return (
    <>
      <header className="App-header">
        {Doc === undefined ? (
          <Navbars navigate={navigate} languages="English" />
        ) : Doc === "Thai" ? (
          <Navbars navigate={navigate} languages="Thai" />
        ) : Doc === "German" ? (
          <Navbars navigate={navigate} languages="German" />
        ) : (
          <Navbars navigate={navigate} languages="English" />
        )}
      </header>
      {Doc === "English" ? (
        <Modal
          hideBackdrop
          open={open}
          onClose={handleClose}
          aria-labelledby="keep-mounted-modal-title"
          aria-describedby="keep-mounted-modal-description"
        >
          <Box
            sx={{
              position: "absolute",
              top: "50%",
              left: "16%",
              transform: "translate(-50%, -70%)",
              width: 400,
              bgcolor: "background.paper",
              boxShadow: 24,
              p: 4,
              borderRadius: 5,
              border: "1px solid #E5E5E5",
              textAlign: "center",
            }}
          >
            <Typography
              id="keep-mounted-modal-description"
              sx={{ mt: 2, fontWeight: 700 }}
            >
              {overviewEN[20].label}
            </Typography>
            <Typography
              id="keep-mounted-modal-description"
              sx={{
                mt: 2,
                textAlign: "left",
                overflowY: "auto",
                height: 200,
              }}
            >
              {overviewEN[8].label}
            </Typography>
            <div
              style={{
                textAlign: "left",
                borderTop: "1px solid #C4C4C4",
              }}
            ></div>

            <div style={{ marginTop: 10, textAlign: "left", float: "left" }}>
              <button
                style={{
                  height: 40,
                  background: " #034D82",
                  borderRadius: 5,
                  color: "#FFFFFF",
                  fontWeight: 700,
                  border: "none",
                  filter: "drop-shadow(0px 4px 10px rgba(0, 0, 0, 0.1))",
                }}
                onClick={() => handleClose(1)}
              >
                {overviewEN[9].label}
              </button>
            </div>
            <div style={{ marginTop: 10, textAlign: "right" }}>
              <button
                style={{
                  height: 40,
                  borderRadius: 5,
                  color: "#034D82",
                  fontWeight: 700,
                  filter: "drop-shadow(0px 4px 10px rgba(0, 0, 0, 0.1))",
                  background: "#FFFFFF",
                  border: "1px solid #034D82",
                }}
                onClick={() => handleClose(2)}
              >
                {overviewEN[10].label}
              </button>
            </div>
          </Box>
        </Modal>
      ) : Doc === "Thai" ? (
        <Modal
          hideBackdrop
          open={open}
          onClose={handleClose}
          aria-labelledby="keep-mounted-modal-title"
          aria-describedby="keep-mounted-modal-description"
        >
          <Box
            sx={{
              position: "absolute",
              top: "50%",
              left: "16%",
              transform: "translate(-50%, -70%)",
              width: 400,
              bgcolor: "background.paper",
              boxShadow: 24,
              p: 4,
              borderRadius: 5,
              border: "1px solid #E5E5E5",
              textAlign: "center",
            }}
          >
            <Typography
              id="keep-mounted-modal-description"
              sx={{ mt: 2, fontWeight: 700 }}
            >
              {overviewTH[20].label}
            </Typography>
            <Typography
              id="keep-mounted-modal-description"
              sx={{
                mt: 2,
                textAlign: "left",
                overflowY: "auto",
                height: 200,
              }}
            >
              {overviewTH[8].label}
            </Typography>
            <div
              style={{
                textAlign: "left",
                borderTop: "1px solid #C4C4C4",
